function Model(){var n=this;n.loaded=ko.observable(!0);n.address=ko.observable();n.transactionId=ko.observable();n.inProgress=ko.observable(!1);n.captcha=ko.observable();n.errorMessage=ko.observable();n.disableSubmit=ko.computed(function(){return n.inProgress()||$.trim(n.address()).length!=34||n.captcha()==null});n.onSendClick=function(){n.inProgress(!0);n.errorMessage(null);$.ajax({url:"api/Faucet/SendCoin",method:"POST",data:JSON.stringify({address:n.address(),captcha:grecaptcha.getResponse()}),dataType:"json",contentType:"application/json; charset=utf-8"}).done(function(t){n.transactionId(t.transactionId);n.address("")}).fail(function(t){var i=t.responseJSON;i&&i.errorMessage?n.errorMessage(i.errorMessage):n.errorMessage("Sorry, an error occured. Please try again later.")}).always(function(){n.captcha(null);grecaptcha.reset();n.inProgress(!1)})}}function captcha(n){model.captcha(n)}ko.punches.enableAll();var model=new Model;ko.applyBindings(model);